Count 2 - Battery (DVO) - Guilty plea.   Convicted.   State moves to dismiss and read in count 1, strangulation and suffocation; count 3 & 4, 2 cts. bail jumping.   Motion granted.   Sentences are withheld.   Defendant is placed on probation to DOC for two (2) years.   Conditions of probation are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
2) Domestic violence assessment and follow through;
3) Have no contact with the victim, Jean Nelson, unless approved by the probation agent;
4) Pay costs of action;
5) Pay supervision fees in an amount to be determined by DOC;
6) Provide DNA sample;
7) Sixty (60) days jail; Forty-five (45) days, imposed and stayed, to be imposed upon the agent's discretion; Fifteen (15) days, under the Huber Law, to commence on 11-05-15 by 6:00 p.m.   
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief.   
Minutes.
